import React from 'react';
import {
  MDBInput,
  MDBBtn,
} from 'mdb-react-ui-kit';
import contactImage from '../../images/'

function Contact() {
  return (


<div class="container">
  <div class="row gx-1 justify-content-around">

    <div class="col-md-6">
      <div class="container  h-100" style={{ marginBottom: '225px', marginTop:'210px' }}>
          <div class="row justify-content-center">
            <div class="col-8">
          <form>
            <MDBInput id='form4Example1' wrapperClass='mb-4' label='Name' />
            <MDBInput type='email' id='form4Example2' wrapperClass='mb-4' label='Email address' />
            <MDBInput wrapperClass='mb-4' textarea id='form4Example3' rows={4} label='Message' />

            

            <MDBBtn type='submit' className='mb-4' block>
            Submit
            </MDBBtn>
          </form>
          </div>
        </div>
    </div>

    </div>
    <div class="col-md-6">
    <img
                src={contactImage}
                alt="home pic"
                className="img-fluid"
                style={{ maxHeight: "450px" }}
              />

    </div>

  </div>
</div>









    
  );
}

export default Contact;
